import React from "react";

const PaginationFooter = ({ cardsPerPage, totalCards, paginate }) => {
  const pageNumbers = [];

  for (let i = 1; i <= Math.ceil(totalCards / cardsPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <Pagination>
      <Pagination.First />
      <Pagination.Prev />
      <Pagination.Item>{1}</Pagination.Item>
      <Pagination.Ellipsis />

      <Pagination.Item>{number - 2}</Pagination.Item>
      <Pagination.Item>{number - 1}</Pagination.Item>
      <Pagination.Item active>{number}</Pagination.Item>
      <Pagination.Item>{number + 1}</Pagination.Item>
      <Pagination.Item disabled>{number + 2}</Pagination.Item>

      <Pagination.Ellipsis />
      <Pagination.Item>{20}</Pagination.Item>
      <Pagination.Next />
      <Pagination.Last />
    </Pagination>
  );
};

export default PaginationFooter;
